import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, useNavigate } from 'react-router-dom';
import LoginUserPage from './LoginUserPage';
import HomePage from './HomePage';
import LoginAdminPage from './LoginAdminPage';
import AdminCRUDBanners from './AdminCRUDBanners';
import SamSung from './Samsaung';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [userAuthenticated, setUserAuthenticated] = useState(false);
  const [adminAuthenticated, setAdminAuthenticated] = useState(false);
  const navigate = useNavigate();

  const handleUserLogin = () => {
    setUserAuthenticated(true);
    navigate('/homepage');
  };

  const handleAdminLogin = () => {
    setAdminAuthenticated(true);
    navigate('/adminpage');
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/userlogin"
          element={
            userAuthenticated ? (
              <Navigate to="/homepage" />
            ) : (
              <LoginUserPage onLogin={handleUserLogin} />
            )
          }
        />
        <Route
          path="/homepage"
          element={userAuthenticated ? <HomePage /> : <Navigate to="/userlogin" />}
        />
        <Route
          path="/adminlogin"
          element={
            adminAuthenticated ? (
              <Navigate to="/homepage" />
            ) : (
              <LoginAdminPage AdminonLogin={handleAdminLogin} />
            )
          }
        />
        <Route
          path="/adminpage"
          element={
            adminAuthenticated ? <AdminCRUDBanners /> : <Navigate to="/adminlogin" />
          }
        />
        <Route
          path="/Samsung"
          element={adminAuthenticated ? <SamSung /> : <Navigate to="/adminlogin" />}
        />
      </Routes>
    </Router>
  );
}

export default App;
